      {id:4,name:'Qual seu tipo de familia? ',img: ImageQuiz4, realizado: true},]);
  },[]);

  return ( 
    <>
    <NavigationBar/>

    <Container > 
     <Row>
      <Col>

      </Col>
     </Row>
    </Container>   

    </>
  );
}

export default Quiz;
